[idle_timeout]
timeout: 72000


#####################################################################
# 	XY Stepper Settings
#####################################################################

[stepper_x] #driver0
step_pin: PF13
dir_pin: !PF12
enable_pin: !PF14
microsteps: 32
rotation_distance: 40
full_steps_per_rotation: 200  
endstop_pin: !PG6
position_endstop: 0
position_max: 225
homing_speed: 80

[tmc2240 stepper_x]
#uart_pin: PC4
cs_pin: PC4
spi_bus: spi1
diag1_pin: PG6
run_current: 1.25
#stealthchop_threshold: 99999
interpolate: True


[stepper_y] #driver1
step_pin: PG0
dir_pin: !PG1
enable_pin: !PF15
microsteps: 32
rotation_distance: 40
full_steps_per_rotation: 200  
endstop_pin: !PG9
position_min: -10
position_max: 233
position_endstop: -10
homing_speed: 80

[tmc2240 stepper_y]
#uart_pin: PD11
cs_pin: PD11
spi_bus: spi1
run_current: 1.25
#stealthchop_threshold: 99999
interpolate: True


[stepper_x1] #driver4
step_pin: PF9
dir_pin: !PF10
enable_pin: !PG2
microsteps: 32
rotation_distance: 40
full_steps_per_rotation: 200  

[tmc2240 stepper_x1] 
cs_pin: PF2
spi_bus: spi1
run_current: 1.25
#stealthchop_threshold: 99999
interpolate: True


[stepper_y1] #driver5
step_pin: PC13
dir_pin:!PF0
enable_pin: !PF1
microsteps: 32
rotation_distance: 40
full_steps_per_rotation: 200  

[tmc2240 stepper_y1] 
cs_pin: PE4
spi_bus: spi1
run_current: 1.25
#stealthchop_threshold: 99999
interpolate: True

[autotune_tmc stepper_x]
